import React from 'react';

let curDate = new Date(2020, 5, 5, 5);
curDate = curDate.getHours();

let greeting = " ";
if(curDate>=1 && curDate<12){

    greeting = "Good Morning";  

}else if(curDate>=12 && curDate<19){

    greeting = "Good Afternoon"; 

}else{

    greeting = "Good Night"
}



function App(){

    return(
    <h1>Hello All, {greeting} </h1>
    );

}

export default App;
